import React from "react";
function List() {
  return (
    <ul className="list-group">
   
      <li className="bg-dark text-white list-group-item">
        <input type="" ></input>
      </li>
      <li className=" bg-dark  text-white list-group-item">2</li>
      <li className=" bg-dark text-white  list-group-item">3</li>
    
    </ul>
  );
}
export default List;
